import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import './index.css';
import Sdata from './Sdata';

ReactDOM.render(
  <>
    <h1 className='heading'>TVF Best Web Series</h1>
    {Sdata.map((val) => {
      return (
        <Card
          key={val.id}
          simg={val.simg}
          sname={val.sname}
          stitle={val.stitle}
          slink={val.slink}
        />
      );
    })}
  </>,
  document.getElementById('root')
);
